original_text.24:
@elfjebooty Lieve schat,
Zonder progressie in het maatschappelijke leven hadden vrouwen nu nog vele miskramen gehad. Werpen was een doel om te overleven.
Gelukkig hebben we hele slimme mensen die doorgeleerd hebben om deze ellende te voorkomen.

full_text.24:
@elfjebooty Sweetheart,
Without progression in social life, women would have had many miscarriages today. Childbirth was a goal for survival.
Fortunately, we have very smart people who have continued to study to prevent this misery.
